// Add municipalities to the map with distinct boundaries
L.geoJSON(municipalities, {
    style: function (feature) {
        return {
            color: 'black',
            weight: 2,
            fillColor: feature.properties.color,
            fillOpacity: 0.5
        };
    },
    onEachFeature: function (feature, layer) {
        layer.bindTooltip(feature.properties.name, {
            permanent: true,
            direction: 'center',
            className: 'municipality-label'
        });

        layer.on('click', function () {
            window.location.href = feature.properties.url;
        });
    }
}).addTo(map);

// Add search control
L.control.search({
    position: 'topleft',
    layer: L.geoJSON(municipalities),
    initial: false,
    zoom: 12,
    marker: false
}).addTo(map);